function myFun(){
    var e = document.getElementsByClassName("eve")[0]
    e.style.color = 'red';
}

function Event(){
    return(
        <>
        <p className="eve">this iss a pera </p>
        <button className="btn btn-xl" onClick={myFun}>click</button>
        <button className="btn btn-xl" onMouseOver={myFun}>click</button>        
        <button className="btn btn-xl" onMouseOut={myFun}>click</button>
        </>

    )
}

export default Event
